    false,nt"url": null,nt"notes": "This annual narrative report for Arrowwood
    Water Management District outlines District accomplishments during the 1982 calendar
    year. The report begins by summarizing the weather conditions and water conditions
    during the year. Wildlife- including migratory birds, upland game birds, big game
    animals,  and raptors- is also covered. The District development and maintenance
    section discusses physical developments. A progress report on field investigations
    and applied research is also provided. The public relations section of the report
    discusses recreational uses, hunting, and fishing. Photographs are attached.",nt"license_title":
